[Briefing]
1=There is a River in this area we want to control. However, the Allies control
2=the West side already and are planning to control the East very soon. Your
3=job is to move in the area and destroy the Allied forces giving us complete
4=control of the river. The only river crossing is heavily fortified. Once you find it
5=we will send some air support. We also believe the Allies have some of our
6=stolen Phase Tanks in the area. If you come across them, destroy them.
7=The Allies will never have our Phase technology! Good Luck!

